import React from "react";
import headerLogo from "../images/logo.svg";
import { useNavigate } from "react-router-dom";

function Register() {
  const navigate = useNavigate()

  const goToLogin = () =>{
    navigate ('/sign-in');
  }
  return(
    <>
    <header className="header">
      <img className="header__logo" alt="Логотип" src={headerLogo} />
      <button className="header__button-exit" onClick={goToLogin}>Войти</button>
    </header>
        <body>
        <form className="registration">
          <h2 className="registration__title">Регистрация</h2>
          <input className="registration__input" placeholder="Email"></input>
          <input className="registration__input" placeholder="Password"></input>
          <button className="registration__submit">Зарегестрироваться</button>
          <button className="registration__link" onClick={goToLogin}> Уже зарегистрированны? Войти</button>
          </form>
        </body>
</>

  )
  }

  export default Register;
